import styles from "./styles/Header.module.css";

function Header() {
  return (
    <div className={styles.header}>
      <div>
        <span className={styles.phone}>Call 021 152 33789</span>
        <span className={styles.search}>SEARCH</span>
      </div>
    </div>
  );
}

export default Header;
